import React from 'react';

const style={
    row:{

    },
    line:{
        zIndex:'2',
        position:'absolute',
        borderLeft:"6px solid #0688FA",
        height:'100%',
        marginLeft:"15px"
    },
    icon:{
        position:'absolute',
        zIndex:3
    },
    content:{
        marginLeft:'75px'
    }      
}
export default function TimelineCard({iconURL,year,content}){
    return(
        <div

            className="row flex-nowrap">

            <p className="pl-2 pr-2">{year} </p>

            <div>
                <div 

                    className='m-0 p-0 h-100'>

                        <img style={style.icon}className='u-icon u-icon--md' src={iconURL} alt='icon' />
                        <span style={style.line}>{" "}</span>


                </div>

            </div>

                <p style={style.content}>
                    {content}
                </p>

        </div>
    )
}
